import React from 'react';
import {useState} from 'react';
import ReactDOM from 'react-dom/client';
import { Link } from "react-router";



export default function Page3() {
/*
    const [inputs, setInputs] = useState({});
    const handleChange = (event) => {
        const name = event.target.name;
        const value = event.target.value;
        setInputs(values => ({...values, [name]: value}))
      }
      const handleSubmit = (event) => {
        event.preventDefault();  
      }
*/
    return (
        <main>
           ! <form onSubmit={handleSubmit}>
            <h1>MedLab Registration Form</h1>
            <h2>Create Appointment</h2>
            <label for="cars">Appointment type:</label>
                <select name="appointments">
                    <option value="Drug test">Drug test</option>
                    <option value="DOT examination">DOT examination</option>
                    <option value="Consultation">Consultation</option>
                    <option value="Blood work">Blood work</option>
                </select> 
                <br/><br/>
                <label>Do you have a reference number?</label><br/><br/>
                <input type="radio" id="yes" name="reference"></input>
                <label for="yes">Yes</label>
                <input type="radio" vid="no" name="reference"></input>
                <label for="no">No</label><br/><br/>

                <Link to="/page3">
                    <input type="submit" value="Next" />
                </Link>
            </form>
        </main>
    )
}
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
 <Page3/>
);
